 public  class MockUserChallengeService :Mock<IUserService>
  {

    public MockUserChallengeService MockGetUsersList(UserModel[] results)
    {
      Setup(x => x.GetUsersList(It.IsAny<int>()))
          .Returns(results);

      return this;
    }
    public MockUserChallengeService MockGetByID(UserModel result)
    {
      Setup(x => x.GetUserById(It.IsAny<Guid>()))
          .Returns(result);

      return this;
    }

    public MockUserChallengeService MockGetByIDInvalid()
    {
      Setup(x => x.GetUserById(It.IsAny<Guid>()))
          .Throws(new Exception("User with that ID was not found!"));

      return this;
    }

    public MockUserChallengeService VerifyGetByID(Times times)
    {
      Verify(x => x.GetUserById(It.IsAny<Guid>()), times);

      return this;
    }
    public MockUserChallengeService MockGetAll(UserModel[] results)
    {
      Setup(x => x.GetUsersList(It.IsAny<int>()))
          .Returns(results);

      return this;
    }

    public MockUserChallengeService VerifyGetAll(Times times)
    {
      Verify(x => x.GetUsersList(It.IsAny<int>()), times);

      return this;
    }



